import React from "react";
import { useNavigate } from "react-router-dom";
import "../App.css";

const LandingPage = () => {
  const navigate = useNavigate();

  return (
    <div className="landing-container" style={{ backgroundColor: "#F0DFC3", fontFamily: "Proxima Nova", minHeight: "100vh", position: "relative", padding: "50px" }}>
      <h1 style={{ fontSize: "50px", fontWeight: "bold", color: "#A6785E", textAlign: "center", marginBottom: "30px" }}>
        Historian Dictionary
      </h1>
      <p style={{ fontSize: "30px", color: "#50464E", textAlign: "center", maxWidth: "800px", margin: "0 auto 50px" }}>
        The Dictionary Grammar and Spelling Checker is a Python-based tool designed to correct
        common errors while recognizing foreign words, proper nouns, and specialized terms.
        With sentence-level implementation and word-level focus separately managed, this program
        ensures accurate and context-aware corrections tailored for dictionary use.
      </p>
      <div style={{ display: "flex", justifyContent: "center", gap: "40px", marginBottom: "50px" }}>
        <button
          style={{ fontSize: "40px", backgroundColor: "#DEA93D", color: "white", padding: "20px 40px", borderRadius: "10px", border: "none", cursor: "pointer" }}
          onClick={() => navigate("/edit-document")}
        >
          Edit Document
        </button>
        <button
          style={{ fontSize: "40px", backgroundColor: "#DEA93D", color: "white", padding: "20px 40px", borderRadius: "10px", border: "none", cursor: "pointer" }}
          onClick={() => navigate("/data-storage")}
        >
          Data Storage
        </button>
      </div>
      <p style={{ fontSize: "20px", color: "#50464E", position: "absolute", bottom: "20px", right: "20px" }}>
        Credit @Duke University
      </p>
    </div>
  );
};

export default LandingPage;
